export function editHairFilters(filters){
    return function(dispatch){
            dispatch({
                type:"HAIR_FILTERS",
                payload: filters
            });
    }
}

export function addHairFilter(filter){
    return function(dispatch){
            dispatch({
                type:"HAIR_FILTERS_ADD",
                payload: filter
            });
    }
}

export function removeHairFilter(filter){
    return function(dispatch){
            dispatch({
                type:"HAIR_FILTERS_REMOVE",
                payload: filter
            });
    }
}

